import {
  Container,
  BreadcrumbItem,
  Row,
  Col,
  Breadcrumb,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button,
  Form,
  FormInput,
  FormGroup,
  Collapse,
  Badge
} from "shards-react";
import Head from "next/head";
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect";
import SEO from "react-seo-component";

// Layout
import Layout from "../components/Layout";
import Img from "react-image";
import Collapsible from "react-collapsible";

// Common
import PDFFile from "../common/PDFFile";

const liStyle = { paddingBottom: "15px" };

var today = new Date();
var dd = String(today.getDate()).padStart(2, "0");
var mm = String(today.getMonth() + 1).padStart(2, "0"); //January is 0!
var yyyy = today.getFullYear();

today = mm + "/" + dd + "/" + yyyy;

class Resources extends React.Component {
  constructor(props) {
    super(props);

    this.state = { collapse: false };
  }

  render() {
    return (
      <Layout>
        <SEO
          title={"Resources | CXC Spanish Online"}
          pathname={"https://www.cxcspnish/mailing-list"}
          description={
            "Download CXC past papers for free, for both CSEC and CAPE. Pass your Spansih exam with our free online study guide."
          }
          siteLanguage={"en"}
          twitterUsername={"_rxheem"}
          author={"Raheem McDonald"}
          article={true}
          publishedDate={today}
          modifiedDate={today}
        />

        <Container>
          <Breadcrumb>
            <BreadcrumbItem>
              <a href="/">Home</a>
            </BreadcrumbItem>
            <BreadcrumbItem active>Resources</BreadcrumbItem>
          </Breadcrumb>

          <Row>
            <Col sm={12} md={8} lg={8} xl={8}>
              <Card>
                <CardBody></CardBody>
              </Card>
            </Col>
            <Col sm={12} md={4} lg={4} xl={4}>
              <Card>
                <CardBody></CardBody>
              </Card>
            </Col>
          </Row>
        </Container>
      </Layout>
    );
  }
}

export default Resources;
